(2, '<h3 style=\"text-align:center\">Visi</h3>\r\n                                    <p><span style=\"background-color: rgb(255, 255, 0);\"><font color=\"#000000\">HAHAHdsada</font></span></p><br>\r\n                                    <h3 style=\"text-align:center\">Misi</h3>\r\n                                    <p><b>Komitmen kami dari awal :</b></p>\r\n                                    <ul><li>Mempersiapkan calon-calon \r\nhaji yang berilmu, mandiri, siap mental, kaya spiritual, dan menjiwai \r\nrahasia-rahasia haji yang terkandung.</li><li>Teguh dalam prinsip akidah yang lurus, jauh dari perilaku syirik, khurafat, dan takhayul.</li><li>Istiqamah meneladani \r\nRasulullah SAW dalam semua rangkaian manasik, berusaha mencontoh beliau \r\nsedaya kemampuan tanpa sikap mengabaikan dan menyepelekan.</li></ul><br>\r\n                                    <p><b>Tekad kami :</b></p>\r\n                                    <ul><li>Mengantar dan membimbing jamaah untuk mencapai haji terbaik, haji yang mabrur yang diridhai Allah SWT.</li><li>Melayani setulus hati, penuh tanggung jawab dan persaudaraan.</li><li>Berusaha menciptakan kebersamaan, tolong menolong, dan saling meringankan diantara sesama jamaah.</li></ul><br>\r\n                                    <p><b>Untuk tujuan mulia itu :</b></p>\r\n                                    <ul><li>Kami akan melakukan \r\nbimbingan yang intensif, fokus dalam memahami semua yang terkait dengan \r\nhaji, sehingga setiap calon haji benar-benar siap untuk menempuh \r\nperjalanan suci yang penuh tantangan ini. Bersikap antisipasi, objektif,\r\n sabar dan tawakkal kepada Allah SWT.</li></ul><br>\r\n                                    <p><b>Kami akan berusaha maksimal dalam bimbingan dan pelayanan :</b></p>\r\n                                    <ul><li>Mengutamakan nilai-nilai \r\nspiritual ilahiyah adalah target awal kami, namun tidak juga mengabaikan\r\n ziarah atsariyah (tour spiritual sejarah) yang akan memperluas dan \r\nmemperkaya wawasan, guna mengungkapkan keagungan Allah SWT.</li></ul><p><span style=\"font-family: \" arial\";\"=\"\"></span></p>', 6, '2020-11-21 10:43:55');
