(5, '<h3 class=\"text-center\">LAPORAN PELAKSANAAN KEGIATAN MANASIK HAJI KBIH ILTIZAM 1440 H / 2019 M</h3><p><img style=\"width: 1028px;\" src=\"data:image/jpeg;base64,\" data-filename=\"manasik-haji.jpg\"></p><h5 class=\"text-center\">NO. SK. IZIN OPERASIONAL KBIH ILTIZAM MALANG \r\nKAKANWIL KEMENAG PROVINSI JAWA TIMUR NO. 1655 TAHUN 2017 DITETAPKAN DI \r\nSIDOARJO, 7 MARET 2017</h5>\r\n            <h6 class=\"text-center\">Sekretariat Jl. Mertojoyo F/3 Merjosari Malang<br>Telp : (0341) 463661 - 553831</h6>\r\n\r\n            <h3 class=\"mt-4 border-bottom\">PENDAHULUAN</h3>\r\n            <h6>Komitmen kami dari awal :</h6>\r\n            <ul><li>Mempersiapkan calon-calon haji yang berilmu, \r\nmandiri, siap mental, kaya spiritual, dan menjiwai rahasia-rahasia haji \r\nyang terkandung.</li><li>Teguh dalam prinsip akidah yang lurus, jauh dari perilaku syirik, khurafat, dan takhayul.</li><li>Istiqamah meneladani Rasulullah SAW dalam semua \r\nrangkaian manasik, berusaha mencontoh beliau sedaya kemampuan tanpa \r\nsikap mengabaikan dan menyepelekan.</li></ul>\r\n            <h6>Tekad kami :</h6>\r\n            <ul><li>Mengantar dan membimbing jamaah untuk mencapai haji terbaik, haji yang mabrur yang diridhai Allah SWT.</li><li>Melayani setulus hati, penuh tanggung jawab dan persaudaraan.</li><li>Berusaha menciptakan kebersamaan, tolong menolong, dan saling meringankan diantara sesama jamaah.</li></ul>\r\n            <h6>Untuk tujuan mulia itu :</h6>\r\n            <ul><li>Kami akan melakukan bimbingan yang intensif, fokus \r\ndalam memahami semua yang terkait dengan haji, sehingga setiap calon \r\nhaji benar-benar siap untuk menempuh perjalanan suci yang penuh \r\ntantangan ini. Bersikap antisipasi, objektif, sabar dan tawakkal kepada \r\nAllah SWT.</li></ul>\r\n            <h6>Kami akan berusaha maksimal dalam bimbingan dan pelayanan :</h6>\r\n            <ul><li>Mengutamakan nilai-nilai spiritual ilahiyah adalah \r\ntarget awal kami, namun tidak juga mengabaikan ziarah atsariyah (tour \r\nspiritual sejarah) yang akan memperluas dan memperkaya wawasan, guna \r\nmengungkapkan keagungan Allah SWT</li></ul>\r\n\r\n\r\n            <h3 class=\"mt-4 border-bottom\">PELAKSANAAN BIMBINGAN MANASIK HAJI</h3>\r\n            <p>KBIH ILTIZAM melaksanakan bimbingan manasik haji 1440 H setiap hari Ahad, dimulai tanggal dimulai <b>17 Februari s.d 21 April 2019</b>\r\n (10 kali pertemuan), bertempat di Auditorium Politeknik Negeri Malang. \r\nMulai jam 07.30 s.d. 11.45 WIB. Dengan materi dua sesi setiap pertemuan.\r\n Dalam pelaksanaan manasik dilakukan dua kali praktek ibadah langsung, \r\nyaitu pada pertemuan ke-6 dan ke-10.</p>\r\n            <p>Untuk kesempurnaan manasik, dilaksanakan pemantapan dan \r\npembinaan pada tarawihan keliling di rumah calon jamaah haji setiap hari\r\n Sabtu dan Ahad malam (8 kali pertemuan) ditambah <i>briefing</i> akhir \r\nsebelum keberangkatan yang dilaksanakan sesudah Idul Fitri, berupa Halal\r\n bihalal dan jalan sehat bersama setelah mendapatkan kepastian kloter. \r\nTotal jumlah pertemuan bimbingan manasik yang dilaksanakan adalah 20 \r\nkali pertemuan.</p><h3 class=\"mt-4 border-bottom\">FASILITAS JAMAAH HAJI</h3>\r\n            <p>Untuk kemantapan pelaksanaan ibadah haji, KBIH ILTIZAM menyediakan fasilitas yang diberikan kepada setiap calon haji, berupa :</p>\r\n            <ul><li>Buku panduan</li><li>Bergo, dan topi untuk Wanita.</li><li>Kopiah, untuk Pria.</li><li>Jaring koper</li><li>Buku doa</li><li>Syal</li><li>Buku kenangan</li><li>Dan identitas jamaah lainnya.</li></ul>\r\n            <p>Disamping itu pada setiap pertemuan manasik disediakan \r\nsnack, kopi, teh, dan air mineral. Pada pertemuan ke-6 dan ke-10 \r\ndisediakan makan pagi prasmanan.</p>\r\n\r\n\r\n            <h3 class=\"mt-4 border-bottom\">BIAYA MANASIK</h3>\r\n            <p>Untuk pelaksanaan manasik, setiap jamaah dikenakan biaya \r\nRp. 3.000.000,-. Yang diserahkan sebelum pelaksanaan bimbingan melalui \r\nRekening Bank Syariah Mandiri a.n. Amrizal Arief  No.Rek. 700.478.1125,\r\n atau diserahkan ketika pelaksanaan manasik.</p>\r\n\r\n\r\n            <h3 class=\"mt-4 border-bottom\">BIAYA DI TANAH SUCI</h3>\r\n            <p>Untuk kesempurnaan pelaksanaan ibadah dan tour-tour yang \r\ndiadakan, setiap jamaah haji 1440 H / 2019 M, dikenakan biaya Dam \r\nsebesar 490 Real, dan Tour sebesar 160 Real, sehingga total berjumlah \r\n650 Real Saudi. Diserahkan ketika di tanah suci.</p>\r\n\r\n\r\n            <h3 class=\"mt-4 border-bottom\">TOUR DI TANAH SUCI</h3>\r\n            <p>Selama berada di tanah suci diadakan beberapa kali tour, yaitu :</p>\r\n            <b>Makkah : </b>\r\n            <ol><li>Mengenal medan manasik ;  Arafah, Muzdalifah, Mina, Jabal Nur, Jabal Tsur</li><li>Gedung Museum, Gedung Kiswah</li></ol>\r\n            <b>Madinah : </b>\r\n            <ol><li>Uhud, Quba, Kiblatain, Percetakan Al Quran, Mantiqah Baidha (medan magnit)</li><li><br></li><li><h3 class=\"mt-4 border-bottom\">PELAKSANAAN IBADAH HAJI</h3>\r\n\r\n                \r\n                    \r\n\r\n                    \r\n                        \r\n                        \r\n                        \r\n                        \r\n                        \r\n                            \r\n                            \r\n                            \r\n                            \r\n                            \r\n                            <table class=\"table table-bordered table-responsive\"><thead>\r\n                        <tr>\r\n                            <th>NO</th>\r\n                            <th>HARI</th>\r\n                            <th>TANGGAL MASEHI</th>\r\n                            <th>TANGGAL HIJRIYAH</th>\r\n                            <th colspan=\"2\">KEGIATAN</th>\r\n                        </tr>\r\n                    </thead><tbody><tr>\r\n                            <td>1</td>\r\n                            <td>KAMIS</td>\r\n                            <td>11-Jul-19</td>\r\n                            <td>08/11/1440</td>\r\n                            <td colspan=\"2\">Pemberangkatan Malang-Surabaya, Jam 10.00 WIB Kloter 17 SUB</td>\r\n                        </tr><tr>\r\n                            <td>2</td>\r\n                            <td>JUMAT</td>\r\n                            <td>12-Jul-19</td>\r\n                            <td>09/11/1440</td>\r\n                            <td colspan=\"2\">Take Off menuju MADINAH (SV 5405), Jam 12.00 WIB, Landing jam 18.45 WSA.</td>\r\n                        </tr><tr>\r\n                            <td>3</td>\r\n                            <td>SABTU</td>\r\n                            <td>13-Jul-19</td>\r\n                            <td>10/11/1440</td>\r\n                            <td>Hari 01</td>\r\n                            <td>di Madinah, Shalat subuh pertama di Masjid Nabawi</td>\r\n                        </tr><tr>\r\n                            <td>4</td>\r\n                            <td>AHAD</td>\r\n                            <td>14-Jul-19</td>\r\n                            <td>11/11/1440</td>\r\n                            <td>Hari 02</td>\r\n                            <td>di Madinah, tour majmu\'ah Madinah (Uhud, Quba, Kiblatain)</td>\r\n                        </tr><tr><td>5</td><td>AHAD</td><td>15-Jul-19</td><td>12/11/1440</td><td>Hari 03</td><td>di Madinah, Shalat, Ibadah di Masjid Nabawi</td></tr></tbody></table></li></ol>', 9, '2020-11-22 11:23:47');
